    false,nt"url": null,nt"notes": "This sediment database contains location,
    description, and texture of samples taken by numerous marine sampling programs.
    Most of the samples are from the Atlantic Continental Margin of the United States,
    but some are from as diverse locations as Lake Baikal, Russia, the Hawaiian Islands
    region, Puerto Rico, the Gulf of Mexico, and Lake Michigan. The database presently
    contains data for over 23,000 samples, which includes texture data for approximately
    3800 samples taken or analyzed by the Atlantic Continental Margin Program, a joint
    U.S. Geological Survey/Woods Hole Oceanographic Institution project conducted from
    1962 to 1970.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
